import Link from 'next/link';

const Navbar = () => (
 <>
  <ul>
     <li><Link href="/"><a>Home</a></Link></li>
     <li><Link href="about"><a>About</a></Link></li>
   </ul>

<style jsx>{`
  ul {
    background: #333;
    color: #fff;
    disply: flex;
    list-style: none;
  }

  ul li {
    font-size: 18px;
    color: white;
    margin-right: 20px;
  }
`}</style>
  </>
);

export default Navbar;
